--------------------------------------------------------------------------------
-- Execute benchmarks

-- | Benchmark the complete execution of a DSH query
benchmarkDSH :: (Q.QA a, NFData a)
             => String
             -> O.Connection
             -> Q.Q a
             -> B.Benchmark
benchmarkDSH benchName c q = B.bench benchName $ B.nfIO (C.runQ (S.sqlBackend c) q)

--------------------------------------------------------------------------------
-- Benchmark definition

benchmarks :: O.Connection -> [B.Benchmark]
benchmarks c =
    [ B.bgroup "literals"
        [ benchmarkDSH "long [[[Integer]]]" c (Q.toQ xs)
        ]
    ]

main :: IO ()
main = do
    args <- getArgs
    when ("--help" `elem` args) $ do
        putStrLn "bench-micro [criterion args] <dbname>"
        withArgs ["--help"] $ M.defaultMain []
        exitFailure

    let critArgs = init args
    let db = last args
    c <- O.connectODBC $ "DSN=" ++ db
    withArgs critArgs $ M.defaultMain $ benchmarks c
